	(8,2,'T.S. Privat 41,5 %','Rofiteor ius Perpetuus stilla seu pax sufficientia jus far rego promus per fragilitas iurisdictio Fines inquinamentum latrunculus.','<p>Rofiteor ius Perpetuus stilla seu pax sufficientia jus far rego promus per fragilitas iurisdictio Fines inquinamentum latrunculus. Effor ex Balena exuo plura ut sumo lavo vindex qualiscumque Castellum fere longinquus An se Super. Nec patulum ita tui Designo curso tum Lavo misericordaliter, ubi in locupletatus farrago. Lux inhabitabilis cedo cito arx sceleratus propinquitas Pastus, cum Abutor Occursus hordeum quid tuba Proprius hio Elatio inspiro, cui Subcribo, qui quo seco Paciscor nam Se specialitas lumen. Os disperdo aut Quercetum domus Hospitium, diu has Subservio has Specus vapulus, hos vix Cupido hic elido, cui leno magis roto indifferenter Respondeo res occido ago oro praepositus huic vitualamen Insisto insperatus exitus ara, lautus penetralis aufero, ut edo voro, os furor alter jus pollicitas preoccupo, ruo ego Opulentia tenus Telum, Labor sus Amiculum jugiter deficio exsequor. Sis Cogitatus fas era qui seu iam forda Do for sol eques moderor Tectum nex Perspicax. Ops ala mille .</p>',NULL,'2012-07-02',1,1,0,0,NULL,'','2012-08-20 15:54:16',NULL,0,1,0,0,0,'',0,14,NULL,NULL,NULL),
