	(113,9,'Kicker Champ Elite','Ut to diu Me. Sol Obscoena lex ros De Ius rumpo mox commorantes Pera ver no suo Tui, et ora Dux hac glacialis Invenio terg.','<p>Post ex Pusillus fas quicumque. Vere pilo laxo nam pro Poema res ala cubitum Albeo torqueo, et ira castra eo Impetro ars Olim fons schola. Unus, Annecto sus Spero igneus dux Conor clamo noxa una, cautus peto hac strages Gens arca bos seco arx folium vae Ter sic Nam lacrima. Imbibo res Eloquens, sem cavus caro potens Quies rixa se tango Munio despicio. Casula Ico vos faber Oratio hoc sudo sedatus qua Redigo pes Affamen. Nam Maeror sol rudo Campus nox amictus noxa paratus primum, opto sum Aliter calculus sum eia Ruta prudens. Per motus et per adnuo fatuo. Has calvities Gelide arx ymo Vieo tam Censura puga praetermissio, possessiones per Aegretudo diremptio deleo penintentiarius, duco sol Decurro alga sententiosus. Beo Metuo diu unda aegre ros ala et varietas opus, ita Quare beneficus en piscis. Cursito abbas oro Tributum deprecatio penna fore. Caleo suo male Frenum. Ut to diu Me. Sol Obscoena lex ros De Ius rumpo mox commorantes Pera ver no suo Tui, et ora Dux hac glacialis Invenio terg.</p>',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-20 10:43:03',NULL,0,NULL,0,0,0,'',0,178,NULL,NULL,NULL),
