	(194,14,'Article with accessories','Möchten Sie den Verkauf von Zubehör unterstützen, können Sie neben der Beschreibung und der Bewertung einen zusätzlichen Reiter setzen, der alle Zubehörartikel enthält.\nDas Zubehör definieren Sie in der Administration schnell und einfach im Bereich Zubehörartikel. Hier geben Sie einfach die Artikelnummern ein. So gelangt Ihr Kunde mit nur einem Klick auf eine Auswahl von Zubehör und kann hier schnell und einfach weitere Artikel auswählen.','<p>Möchten Sie den Verkauf von Zubehör unterstützen, können Sie neben der Beschreibung und der Bewertung einen zusätzlichen Reiter setzen, der alle Zubehörartikel enthält.</p><p>Das Zubehör definieren Sie in der Administration schnell und einfach im Bereich Zubehörartikel. Hier geben Sie einfach die Artikelnummern ein. So gelangt Ihr Kunde mit nur einem Klick auf eine Auswahl von Zubehör und kann hier schnell und einfach weitere Artikel auswählen.</p><p>So können Sie zu etwa zu Schuhen Schuhspanner und Schuhputzzeug anbieten, oder wie in diesem Beispiel zu einem Kommunikationsgerät ein Head-Set. Eine Cross-Selling-Funktion, die sich für Sie auszahlt.</p>',NULL,'2012-07-16',1,1,100,0,NULL,'','2012-08-22 10:08:00',NULL,0,NULL,0,0,0,'',0,434,NULL,NULL,NULL),
	(195,9,'Kicker Service Box','Oriens propitius, alo ita pax galactinus emo. Lacer hos Immanitas intervigilium, abeo sub edo beo for lea per discidium Inf.','<p>Captivo pala pro de tandem Singulus labor, determino cui Ingurgito quo Ico pax ethologus praetorgredior internuntius. Ops foveo Huius dux respublica his animadverto dolus imperterritus. Pax necne per, ymo invetero voluptas, qui dux somniculosus lascivio vel res compendiose Oriens propitius, alo ita pax galactinus emo. Lacer hos Immanitas intervigilium, abeo sub edo beo for lea per discidium Inf.</p>',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-22 09:57:20',NULL,0,NULL,0,0,0,'',0,435,NULL,NULL,NULL),
	(196,14,'Articles with similar products','Products support not only accessories suggestions, but algo similar products assignment, which are then displayed in the article detail page. This way, your shop customer has a larger selection of products at a glance.','<p>Products support not only accessories suggestions, but algo similar products assignment, which are then displayed in the article detail page. This way, your shop customer has a larger selection of products at a glance.</p>',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-22 10:07:41',NULL,0,NULL,0,0,0,'',0,436,NULL,NULL,NULL),
	(197,14,'ESD Article','Electronic software distribution (ESD) helps you deliver pure software products. These products can be ordered online, paid and provided for download. In addition to software, other digital items, such as E-books, music (mp3), videos or computer games can be offered','<p>Electronic software distribution (ESD) helps you deliver pure software products. These products can be ordered online, paid and provided for download. In addition to software, other digital items, such as E-books, music (mp3), videos or computer games can be offered.</p>',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-30 16:27:18',NULL,0,NULL,0,0,0,'',0,437,NULL,NULL,NULL),
	(198,14,'Article with evaluations','Evaluations offers your customers the possibility to add your personal reviews to your articles while, at the same time, allowing you to demonstrate how much you value their opinion. \n\nComments can be limited to registered customer only. Should a buyer forget to evaluate a purchased article, an automatic reminder can be sent by email.','<p>Evaluations offers your customers the possibility to add your personal reviews to your articles while, at the same time, allowing you to demonstrate how much you value their opinion. </p>\n<p>Comments can be limited to registered customer only. Should a buyer forget to evaluate a purchased article, an automatic reminder can be sent by email.</p>',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-30 16:25:48',NULL,0,NULL,0,0,0,'',0,438,NULL,NULL,NULL),
	(199,14,'Article on sale','With the \"Sale\" function, articles that exist with certain quantities in stock, can be sold off. As soon as the stock reaches 0, these items are automatically shown as unavailable or completely disabled, according to the configurations set by the shop owner.','<p>With the \"Sale\" function, articles that exist with certain quantities in stock, can be sold off. As soon as the stock reaches 0, these items are automatically shown as unavailable or completely disabled, according to the configurations set by the shop owner.</p>',NULL,'2012-06-22',1,1,0,0,NULL,'','2012-08-30 16:23:42',NULL,0,NULL,1,0,0,'',0,439,NULL,NULL,NULL),
	(200,14,'NEW flagged article','Depending on the settings in the backend, newly created articles can be assigned the status flag \"New\" in the frontend','<p>Depending on the settings in the backend, newly created articles can be assigned the status flag \"New\" in the frontend. By default, articles will be flagged as \"New\" for 30 days after creation. You can change this value in the backend, under \"Basic settings\"/\"Frontend\"/\"Top sellers / novelties\".</p>\n<p>Besides this, you can also change a specific article\'s behaviour by manually overriding the date in which it was added to the store.</span></p>',NULL,'2012-08-22',1,1,0,0,NULL,'','2012-08-30 16:19:44',NULL,0,NULL,0,0,0,'',0,440,NULL,NULL,NULL),
	(201,14,'Highlighted article','This option can be used to flag special articles in the frontend. By default, this article as marked as \"Highlight\"','<p><span>This option can be used to flag special articles in the frontend. By default, this article as marked as \"Highlight\"</span></p>',NULL,'2012-07-16',1,1,0,1,NULL,'','2012-08-30 16:17:44',NULL,0,NULL,0,0,0,'',0,441,NULL,NULL,NULL),
	(202,14,'Article with standard configuration','The standard article configurator allows customers to select the desired product variant directly, without following a specific order. All options within the associated groups are selectable directly by the customer.','<p><strong>Here you can see the Standard Configurator</strong></p>\n<p>The Standard Configurator offers the possibility to select from the desired constellation directly, without following a specific order. All variants of the article are directly visible to the customer, an can be selected with just one click</p>\n<p>If the article uses stocks and a specific variant is no longer available, the corresponding option is automatically removed.',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-30 16:15:54',NULL,0,NULL,1,0,0,'',0,444,NULL,NULL,25),
	(203,14,'Article with step-by-step configurator','In the step-by-step configurator, options must be chosen in a specific order. As soon as you make the first selection, the second checkbox is activated. Once the customer has entered his final selection, the \"add to shopping cart\" button made is visible','<p><strong>Step-by-step configurator</strong><br />In the step-by-step configurator, options must be chosen in a specific order. As soon as you make the first selection, the second checkbox is activated. Once the customer has entered his final selection, the \"add to shopping cart\" button made is visible</p>\n<p><strong>Note:</strong><br />Article will be shown even if the stock is \"0\", but with increased delivery time. You can configure this behaviour so that out of stock articles are no longe available. You can see this behaviour in this example by selecting the combination of color \"blue\" and size \"41/42\".</p>',NULL,'2012-06-22',1,1,0,0,NULL,'','2012-08-30 16:12:44',NULL,0,NULL,1,0,0,'',0,549,NULL,NULL,26),
	(204,14,'Article with table configurator','With this kind of configurator, the available choices are displayed in a table. The customer sees, at a glance, what options are available and the price associated with each of them.','<p><strong>Table configurator</strong><br />With this kind of configurator, the available choices are displayed in a table. The customer sees, at a glance, what options are available and the price associated with each of them.<br /><strong>Note:</strong> The table display works only with exactly 2 configurator groupes(axis X and Y on the table). If you are using price groups and have defined season prices, season prices are not displayed. We recommend using a different kind of configurator in these cases.<br /><strong>Note:</strong> You can configure the shop to not sell items which stock is 0. In this case, the corresponding option is no longer selectable. You can find an example of this by choosing the color \"blue\" and the \"M\" size</p>',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-30 16:08:58',NULL,0,NULL,1,0,0,'',0,689,NULL,NULL,27),
	(205,14,'Article with surcharge configurator','Combining the configurator and accessories features offers you new possibilities. Now your customers can not only assemble a product according to their wishes, but they can also directly add accessories to it, and purchase the entire selection with a single mouse click.','<p>Combining the configurator and accessories features offers you new possibilities. Now your customers can not only assemble a product according to their wishes, but they can also directly add accessories to it, and purchase the entire selection with a single mouse click</p>',NULL,'2012-06-22',1,1,0,0,NULL,'','2012-08-22 14:48:11',NULL,0,NULL,0,0,0,'',0,726,NULL,NULL,28),
	(206,14,'Article with reference price','This is an example article with reference prices. You can specify a reference price of 1 liter, and Shopware atumatically determines the prices for all variants. The packaging unit can be specified as a bottle, with custom prices, and the resulting calculations are stored as variants, which you can afterwards customize, covering all possible scenarios.','<p>This is an example article with reference prices. You can specify a reference price of 1 liter, and Shopware atumatically determines the prices for all variants. The packaging unit can be specified as a bottle, with custom prices, and the resulting calculations are stored as variants, which you can afterwards customize, covering all possible scenarios.</p>',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-22 15:15:44',NULL,0,NULL,0,0,0,'',0,744,NULL,NULL,29),
	(207,14,'Grouped articles','You can specify, for each individual article, a minimum and maximum purchase quantity. \n\nIn this example, the article has minimum order quantity of 3 units and a maximum of 15. It has also been configured to be bundled in sets of 3.','<p>You can specify, for each individual article, a minimum and maximum purchase quantity.</p>\n<p>In this example, the article has minimum order quantity of 3 units and a maximum of 15. It has also been configured to be bundled in sets of 3.</p>',NULL,'2012-08-22',1,1,0,0,NULL,'','2012-08-30 15:59:57',NULL,0,NULL,0,0,0,'',0,745,NULL,NULL,NULL),
	(208,14,'Pseudo price','The pseudo price appears as  a small and crossed value over the current sale price of your item. Thus, you can inform your customers that you lowered prices, or that you provide it at a different price from the one recommended by the manufacturer. The additional indication of the price difference in percent value shows your customers how much they are saving on this purchase. The input of the pseudo price is done when specifying the item\'s main data, and can be easily modified.','<p>The pseudo price appears as  a small and crossed value over the current sale price of your item. Thus, you can inform your customers that you lowered prices, or that you provide it at a different price from the one recommended by the manufacturer.</p>\n<p>The additional indication of the price difference in percent value shows your customers how much they are saving on this purchase.</p>\n<p>The input of the pseudo price is done when specifying the item\'s main data, and can be easily modified.</p>',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-30 15:54:49',NULL,0,NULL,0,0,0,'',0,746,NULL,NULL,NULL),
	(209,14,'Dynamic price','Dynamic prices allow you to define different prices for different quantities. You can adjust the price, for example, by weight, packaging units (a box of 10 boxes) or decrease in range (50 units equal to a range).','<p>Dynamic prices allow you to define different prices for different quantities. You can adjust the price, for example, by weight, packaging units (a box of 10 boxes) or decrease in range (50 units equal to a range).</p><p>This can be easily configured in the backend section of the shop. In it, you can specify the ranges and their associated prices, in absolute value or as a percentual discount</p><p>Dynamic prices are possible not only with one-dimensional articles, but also with configurable articles (for example: clothing, which differs in color, size, and fabric).</p><p><strong>Alternative:</strong><br>If you want to give your customers discounts after a certain purchase amount is reached, you can do so using \"cart discounts\"</p>',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-22 15:36:02',NULL,0,NULL,0,0,0,'',0,747,NULL,NULL,NULL),
	(210,14,'Premium article for 50 euros cart value','This article can purchase for free or for a premium, cheaper price if the cart values is over 50 euros','<p>This article can purchase for free or for a premium, cheaper price if the cart values is over 50 euros<br />Note:<br />In order to display premium articles, this option has to be enabled in the shop backend</p>',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-30 13:06:37',NULL,0,NULL,0,0,0,'',0,748,NULL,NULL,NULL),
	(211,14,'Premium article for 250 euros cart value','This article can purchase for free or for a premium, cheaper price if the cart values is over 250 euros','<p>This article can purchase for free or for a premium, cheaper price if the cart values is over 250 euros<br />Note:<br />In order to display premium articles, this option has to be enabled in the shop backend</p>',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-30 15:44:28',NULL,0,NULL,0,0,0,'',0,749,NULL,NULL,NULL),
