	(218,15,'All Natural - Lemon Honey soap','Species alimentum os incunabula. vis do aliger, oblittero livor Libet dis cruciamentum vaco nec re horrendus res diu item incrementab.','<p>Ichilominus Fultus ordior, ora Sterilis qua Se sum cum Conspicio sed Eo at ver oportet, filia cedo comprehendo baccatus. Sub Exortus mihi crastinus, per has frequentatio ivi vindico Salveo nutrimens seco Daci prepositus. Ne ora pax Bravium converto Translato, inter Species alimentum os incunabula. vis do aliger, oblittero livor Libet dis cruciamentum vaco nec re horrendus res diu item incrementab.</p>',NULL,'2012-08-29',1,1,2222,0,NULL,'','2012-08-30 15:37:24',NULL,0,NULL,0,0,0,'',0,769,NULL,NULL,34),
	(219,14,'Express shipping','You can offer an express delivery for store goods. The shipping costs are higher than on standard shipping.','<p>You can offer an express delivery for store goods. The shipping costs are higher than on standard shipping.<br /><br />Place these items in the shopping cart, login by using the customer data below and proceed to checkout. Here, you can choose between a \"standard\" and \"express\" shipping. The shipping costs are automatically calculated.<br /><br />Shop customer: <br />max.mustermann@mail.com<br />Password \"shopware\"<br /><br />In this example, advance payment / direct debit are not supported for express shipping.</p>',NULL,'2012-06-12',1,1,0,0,NULL,'','2012-08-30 15:36:37',NULL,0,NULL,1,0,0,'',0,772,NULL,NULL,NULL),
