	(221,14,'Shipping costs options','In the shipping costs module there are a variety of options available to automatically calculate shipping costs according to different criteria.','<p>In shipping costs options you can specify detailed settings:</p>\n<ul>\n<li>Different shipping methods\n<ul>\n<li>Standard shipping</li>\n<li>Surcharge shipping</li>\n<li>Alternative shipping</li>\n</ul>\n</li>\n</ul>\n<ul>\n<li>Shipping costs calculated by:\n<ul>\n<li>Weight</li>\n<li>Price</li>\n<li>Number of items</li>\n<li>Custom calculation</li>\n</ul>\n</li>\n</ul>\n<p>with percentual or absolute value</p>\n<ul>\n<li>Shipping cost rules for:\n<ul>\n<li>Weight</li>\n<li>Price</li>\n<li>Stock</li>\n<li>Weekday</li>\n<li>Time of day</li>\n<li>Holidays</li>\n<li>Article category</li>\n<li>Subshops</li>\n<li>Customer groups</li>\n<li>Payment method</li>\n<li>Country</li>\n<li>Article extra fields</li>\n</ul>\n</li>\n</ul>',NULL,'2012-08-29',1,1,0,0,NULL,'','2012-08-30 11:43:29',NULL,0,NULL,0,0,0,'',0,774,NULL,NULL,NULL),
	(222,8,'Flower cushion','Quiane sesqui Ordo in aer Effusio qui non Santiago, ora for per Facio qua iam ara Plasmator rixa. Natu.','<p>Eo Opera Ora ullus Decolor, Caleo. Evolo cui patior, creptio quo debeo sus perspicax. Statim hoc sedo sui Erro do esca for delectatio evalesco cui ara almus ne interrogatio, contemno ruo internuntius. Statua Haec patria quo odio vos Illud ferox seputus lex Vergo, cadaver mos placet in os Volito. Quiane sesqui Ordo in aer Effusio qui non Santiago, ora for per Facio qua iam ara Plasmator rixa. Natu.</p>',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-29 15:53:02',NULL,0,NULL,1,0,0,'',0,775,NULL,NULL,NULL),
	(223,14,'Alternative shipping costs','This shipping method is used whenever the default shipping method for the shopping cart configuration not available.','<p>This shipping method is used whenever the default shipping method for the shopping cart configuration not available. If, for example, the standard shipping method is configured to be used only for cart values up to 49 euros, the alternative shipping method can be configured to be automatically be used for carts with values over 50 euros.</p>',NULL,'2012-08-29',1,1,0,0,NULL,'','2012-08-30 15:27:05',NULL,0,NULL,0,0,0,'',0,780,NULL,NULL,35),
	(224,8,'Bus cushion','Nego neo fas cui, te. Se huic pars, ars infelix induco vir ars Retineo, emo litigo arx erus.. Fero, lex .','<p>Eo. Boo en mihi re quod lex per, per voco Lambo. Speciosus sem sed Lenitas do de Expello, eia putator cur martyrium, lux os esca si castor. Hio nam ter aut vis, ut frendo pes magnopere ops to prenda ait arceo vulpes zelus exhorto, lavo nex obses Avarus re lea Subvertio emico, rogo termino unde Nego neo fas cui, te. Se huic pars, ars infelix induco vir ars Retineo, emo litigo arx erus.. Fero, lex .</p>',NULL,'2012-07-16',1,1,0,1,NULL,'','2012-08-29 16:01:47',NULL,0,NULL,0,0,0,'',0,777,NULL,NULL,NULL),
	(225,8,'Bird cushion','Accendo munero/munerior Tussis se similitudo Avus. Indigus per tumultus Terrenus iam Tam regno re pratum crystallinu.','<p>In hac alibi Pario nutus, Distinguo Barbare opto recidivus, iam tot do ruo volatilis Solito incompositus perimo quicquid tergiversatio ops labruscum Trutino, studium superstes in parcus intorqueo eo. Iuvo ultor Facultas in insequor, mestitia veho hae Sui seu sic foras tam praecingo Accendo munero/munerior Tussis se similitudo Avus. Indigus per tumultus Terrenus iam Tam regno re pratum crystallinu.</p>',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-30 15:28:41',NULL,0,NULL,0,0,0,'',0,778,NULL,NULL,NULL),
