	(227,14,'Surcharges for payment methods','In Shopware you can define surcharges for specific payment methods\nIn this example, a 5 euros surcharged is applied for payments with \"Invoice\".\nLogin with customer email max.mustermann@mail.com (password: shopware) and go on the \"My account\" section. There, change the payment method to \"Invoice\".\nYou can now check your cart to see the surcharge.','<p>In Shopware you can define surcharges for specific payment methods<br />In this example, a 5 euros surcharged is applied for payments with \"Invoice\".<br />Login with customer email max.mustermann@mail.com (password: shopware) and go on the \"My account\" section. There, change the payment method to \"Invoice\".<br />You can now check your cart to see the surcharge.</p>',NULL,'2012-08-29',1,1,0,0,NULL,'','2012-08-30 15:18:49',NULL,0,NULL,0,0,0,'',0,782,NULL,NULL,NULL),
