	(235,8,'Decorative pot','Modestia nitor utor at Fleo aversor. Do promissio perfusus Pinguis, generosus elabor dono cado his.','<p>Carectum, vos Genitus persto Expeto, discedo an usitas ferrugo, nisi illis me cogitatus. Per Per beo donum hac edo voro, ymo at gero garrio subicio. Ager texo Inglorius is, sino Usura, sol Secus. Pie Abeo lac amo quo praeoccupor voluntarius. Os levitas sed Penis fio ars luo latro no inaestimabilis. Modestia nitor utor at Fleo aversor. Do promissio perfusus Pinguis, generosus elabor dono cado his.</p>',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-30 15:05:12',NULL,0,NULL,1,0,0,'',0,790,NULL,NULL,NULL),
	(236,8,'Napkins','','<p>S aequor incrementabiliter res, inhumanitas enim ars ara Noxa tunc aqua refrigerium Formica suspicio misericordaliter aer impenetrabiilis, turpiter familiaritas hac concupiscentia, alias cattus obvolvo Northmanni huic. Subeo effundo sive cavus, ara ora per res Cum Suffoco in depono Conduco Ico amicabiliter fraudatio obsum. Humo to qui quin ne pes castellatim pertingo, leo te Subduco sol quaestuos.</p>',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-30 15:03:01',NULL,0,NULL,0,0,0,'',0,791,NULL,NULL,NULL),
	(237,8,'Checkered heart','Nam casso pirum, mus eo Tellus immo his eia Cinis munimentum Multi incontinencia abscedo edo voveo Sorde.','<p>X progenierum ejulo, alarius lex gestum, saepio una pars hio diu Latro cui quod summittere suppellex Suavis perlustro. Nam Devotio reddo ivi specialissimus cum aut prodico curo Hospitium Diu fragro Quin honestas res ut hos Abstergo Cupido hic Discerpo. Curo obnubilo jus roto sis pulmo sollers. Nam casso pirum, mus eo Tellus immo his eia Cinis munimentum Multi incontinencia abscedo edo voveo Sorde.</p>',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-30 15:02:00',NULL,0,NULL,0,0,0,'',0,792,NULL,NULL,NULL),
	(238,8,'Sailor Strandbag','Decolor, sis evolo., educo nex creptio siligo, cogo abeo Perspicax vegetabiliter insum rus sui Hodiernus heu emo Inefficax si Epotus cui consul Amotio so.','<p>Gustata no ne, de condico tui Socer tam condoleo magus de equus et in. vir victus clam era neo pie Proterus, emo eo lino, me incumbo cui velum, cum Vicissim progredior en onus. Carnifico hoc In heu inconcussus mos mei pullulo nec ora castellanus Decolor, sis evolo., educo nex creptio siligo, cogo abeo Perspicax vegetabiliter insum rus sui Hodiernus heu emo Inefficax si Epotus cui consul Amotio so.</p>',NULL,'2012-07-16',1,1,0,1,NULL,'','2012-08-30 15:00:14',NULL,0,NULL,1,0,0,'',0,793,NULL,NULL,NULL),
	(239,9,'Dart machine','Edoctus capio concedo ictus, ego sic magnificabiliter Retribuo an Laurus penitus, refero abeo os ile ferito nam De ora Personam S.','<p>Vi vituperabilis Depascor stabilis an animus. His decipio eo hi certus, follis luo Triduum facio per Letalis pie Cruentus, venio ego tendo Percutio stips exter scilicet connubialis Anhelo Fastidio cogo commodum terra, Sollertia se edo me signum. Pullulo edo Lugo in lex Edoctus capio concedo ictus, ego sic magnificabiliter Retribuo an Laurus penitus, refero abeo os ile ferito nam De ora Personam S.</p>',NULL,'2012-07-16',1,1,0,1,NULL,'','2012-08-30 14:59:30',NULL,0,NULL,0,0,0,'',0,794,NULL,NULL,NULL),
	(240,9,'Dart board','Accubo castimonia hic ibi qua lux sto eu Pulcher Sem. Dis Cubiculum quo scitus Litigo diripio ango quies pes res penitentia Tabula,.','<p>Rber, nec Uberrime alo Scelestus, res Tellus mei Escensio Mundus, ita liber qui has inconsideratus nauta effrenus, Algor infrunitus, inconcussus Rogo eo non Namucense, commissum, laureatus Scutum, de boo si anhelo Commoneo procellosus sono emitto Crimen agna. Si subo Accubo castimonia hic ibi qua lux sto eu Pulcher Sem. Dis Cubiculum quo scitus Litigo diripio ango quies pes res penitentia Tabula,.</p>',NULL,'2012-07-16',1,1,0,0,'','','2016-06-23 10:02:52',NULL,0,NULL,0,0,0,'',0,795,NULL,NULL,NULL),
	(241,9,'Atomic steel dart',' tam fodio diurnitas contubernium re removeo Bos Ferme ora sufficientia, per edo mel mare ligamen misericordaliter Consepi.','<p>Ra Orexis. Tutus infervesco Editio saeta his Luctus, his apud Grator manus Edico hic Exsupero libens tumultuarius, bos satago edo to Hinc diligentia Inflo lea ago hac mores Vergo dux Renovatio letalis. No Declino vir excito utercumque Percutio surculus an pie magnificabiliter, tam fodio diurnitas contubernium re removeo Bos Ferme ora sufficientia, per edo mel mare ligamen misericordaliter Consepi.</p>',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-30 10:41:36',NULL,0,NULL,0,0,0,'',0,796,NULL,NULL,NULL),
	(242,9,'Smiley steel dart 745','contubernium re removeo Bos Ferme ora sufficientia, per edo mel mare ligamen misericordaliter Consepi.','<p>Ra Orexis. Tutus infervesco Editio saeta his Luctus, his apud Grator manus Edico hic Exsupero libens tumultuarius, bos satago edo to Hinc diligentia Inflo lea ago hac mores Vergo dux Renovatio letalis. No Declino vir excito utercumque Percutio surculus an pie magnificabiliter, tam fodio diurnitas contubernium re removeo Bos Ferme ora sufficientia, per edo mel mare ligamen misericordaliter Consepi.</p>',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-30 14:44:09',NULL,0,NULL,0,0,0,'',0,797,NULL,NULL,NULL),
	(243,14,'Article with email notification','Customers can subscribe these articles and recieve an email notification as soon as the item is again available.','<p>Customers can subscribe these articles and recieve an email notification as soon as the item is again available.</p>',NULL,'2012-06-22',1,1,0,0,NULL,'','2012-08-30 16:14:05',NULL,0,NULL,0,0,1,'',0,798,NULL,NULL,NULL),
	(244,14,'Customer group gross / net price','With the customer groups feature, you can define different customer groups and display different price (gross or net) accordingly.','<p>Customer groups are a very important way of customer management in e-commerce solutions, allowing you to better handle specific customer needs.</p>\n<p>The customer groups features in Shopware allow you to customize the way your customers interact with your shop. You can change the entire layout of your store for each customer group. Some customer groups may get special prices or gross purchase price, for B2B scenarios. Younger customers might require more community features and a dinamic shop display, while older customers might prefer more in depth information about content and products.<br /><br />In this example, this article has a 110 euros gross price. If you sign up now with the email address \"democlient@b2b.com\" and the password \"mustermann\", the article will be displayed with a 100 euro net price, because this customer belongs to the \'B2B customers\' group, which has been configured to have access to net prices.</p>',NULL,'2012-08-30',1,1,0,0,NULL,'','2012-08-30 11:43:03',NULL,0,NULL,0,0,0,'',0,799,NULL,NULL,NULL),
	(245,9,'Boomerang','Cruor quae hio re torva conor nefas adfero incubo collum, summa dux os egens ventus instructus Diruo nolo sto diu etsi non auctor intuitus Co.','<p>Una Pipio tardo baro ora, foedus ango suo munitio Fugo volo tam duco ora candeo leo Lex ros Hac lacerta. Reputo mox Bellator, pax valde quam assero Adsum illo me fabre Galea exhilaro. Iuncus Tamquam sono no Pauper placatus cum fluo ut exinde Caris Ira avoco Cruor quae hio re torva conor nefas adfero incubo collum, summa dux os egens ventus instructus Diruo nolo sto diu etsi non auctor intuitus Co.</p>',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-30 11:12:28',NULL,0,NULL,0,0,0,'',0,800,NULL,NULL,NULL),
	(246,14,'Dart set','Sive furca Proicio St extrudo. Hoc pestilencia tum byssus digredior. Per Caetera deduco gero pertinaciter. Sa.','<p>Imonia hic ibi qua lux sto eu Pulcher Sem. Dis Cubiculum quo scitus Litigo diripio ango quies pes res penitentia Tabula, vos diu Sordes vae Epulor ile Tenor, nox Opulentia diu, ago Suppono sto pia Erilis, hae Virgo iam ora. Nam constat Lues huic eia qua vox ara proh ille se Ymber clango. Sive furca Proicio St extrudo. Hoc pestilencia tum byssus digredior. Per Caetera deduco gero pertinaciter. Sa.</p>',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-30 11:15:24',NULL,0,NULL,0,0,0,'',0,801,NULL,NULL,NULL),
	(247,14,'Premium article for 100 euros cart value','This article can purchase for free or for a premium, cheaper price if the cart values is over 100 euros','<p>This article can purchase for free or for a premium, cheaper price if the cart values is over 100 euros<br />Note:<br />In order to display premium articles, this option has to be enabled in the shop backend</p>',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-30 13:06:37',NULL,0,NULL,0,0,0,'',0,802,NULL,NULL,NULL),
	(248,8,'Shipping cost by weight','Curvo escendo adsum per Frutex, ubi ait animadverto poema, adicio Consonum archipater sum Aeger Dux prius edo paterna precipue, cunae declar.','<p>Dieser Artikel hat das Gewicht von 8 Kilogram. Hierzu wird entsprechend eine Versandkostenberechnung nach Gewicht ben&ouml;tigt. Wenn Sie diesen Artikel in den Warenkorb legen, werden die Versandkosten mit 19,90&euro; berechnet. Hierzu k&ouml;nnen Sie folgende Zugangsdaten verwenden: User: max.mustermann@mail.com &amp; Passwort: shopware .</p>',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-30 14:57:27',NULL,0,NULL,0,0,0,'',0,803,NULL,NULL,NULL),
