	(13964,213,2,'Surf board','','Enego Do Loci his simul creta humilitas, Excello, se, sis ne fere Amotio turba excedo se res domito Villa, in, fundo novem, per qua tam Acer cornu. ','<p>Enego Do Loci his simul creta humilitas, Excello, se, sis ne fere Amotio turba excedo se res domito Villa, in, fundo novem, per qua tam Acer cornu. Prex niger qui os an calcar, has illi eu opinor eo Iuvenesco, ne mano se noceo, sto vere to Damno occludo, abortio pio os ago ictus imcomposite Vena subvenio, to evado Nitidus qua Immanis pollex, in tutus hae ac no laceratus, hi eo seu his. Laxo se fu.</p>','','','','','',''),
	(13965,211,2,'Bonus article with shopping cart value of over 250 Euro','','Your customers can either buy this article or get it as a free bonus article from a shopping cart value of over 250 Euros.','<p>Your customers can either buy this article or get it as a free bonus article from a shopping cart value of over 250 Euro.</p>\n<p>This function needs to be activated in your backend under Conficuration --&gt; Storefront</p>','','','','','',''),
