	(13979,204,2,'Article with table configurator','','With this configurator variant, your customer gets displayed the selecting opportunities in a table. This way, he can see, which options he has and what they cost.','<p>With this configurator variant, your customer gets displayed the selecting opportunities in a table. This way, he can see, which options he has and what they cost.</p>','','','','','',''),
	(13980,203,2,'Article with choice configurator','','In contrast to the standard configurator, the order of the choice configurator has to be executed step by step.','<p>In contrast to the standard configurator, the order of the choice configurator has to be executed step by step. Having made the first selection, the second box will be activated. Only after filling out the last box, the shopping cart button becomes visible.</p>','','','','','',''),
	(13982,202,2,'Article with standard configurator','','The standard configurator offers the opportunity, to selct the desired constellation, without following a certain order. All groups can be selected by customers with the corresponding options.','<p>The standard configurator offers the opportunity, to selct the desired constellation, without following a certain order. All groups can be selected by customers with the corresponding options.</p>','','','','','',''),
