	(33,8,'|8|3|','Küchenzubehör',2,0,0,0,'2012-08-29 11:28:42','2012-08-29 11:28:42',NULL,'','Vielfältiges Zubehör für Ihre Küche','<p>Secundus pro se mens valde nec mos pia Dispertio, citatus crus finis se nos pes. Sem res Caseus suo pulmentum Requiro fors tandem, revera iam aro cui Ingurgito. Quo insons pera deputo in et. Ops Fateor furs dux per en verus derigo Admoneo ne necne Ne ymo iam Vota, Rutilus.</p>','',0,1,0,1,'',0,0,NULL),
