	(74,10,'|10|3|','Kundengruppen / B2B',7,0,0,0,'2012-08-30 10:55:11','2012-08-30 10:55:11',NULL,'','Kundengruppen','<p><span style=\"color: #555555; font-family: Arial, \'Helvetica Neue\', Helvetica, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none;\">Durch die Kundengruppen-Funktionen in Ihrer Shopware gehen Sie auf diese unterschiedlichen Gruppen zu. Sie k&ouml;nnen das gesamte Layout Ihres Shops auf die jeweilige Kundengruppe zuschneiden. Einige Kundengruppen bekommen besondere Preise, H&auml;ndler vielleicht H&auml;ndlereinkaufspreise. J&uuml;ngere Kunden bedienen Sie mit Community Funktionen und einer peppigen Shopdarstellung, &auml;lteren vielleicht mit deutlich mehr Tiefe und Informationsgehalt.</span></p>','article_listing_1col.tpl',0,1,0,1,'',0,0,NULL),
