	(3,NULL,'sTELLAFRIEND','{config name=mail}','{config name=shopName}','{sName} recommends you {sArticle}','Hello,\n\n{sName} has found an interesting product for you on {sShop} that you should have a look at:\n\n{sArticle}\n{sLink}\n\n{sComment}\n\nBest regards and see you next time\n\nYour contact details','',0,'',2,'a:4:{s:5:\"sName\";s:11:\"Peter Meyer\";s:8:\"sArticle\";s:10:\"Blumenvase\";s:5:\"sLink\";s:31:\"http://shop.example.org/test123\";s:8:\"sComment\";s:36:\"Hey Peter - das musst du dir ansehen\";}'),
	(4,NULL,'sPASSWORD','{config name=mail}','{config name=shopName}','Forgot password - Your access data for {sShop}','Hello,\n\nYour access data for {sShopURL} is as follows:\nUser: {sMail}\nPassword: {sPassword}\n\nBest regards\n\n{config name=address}','',0,'',2,'a:2:{s:9:\"sPassword\";s:7:\"xFqr3zp\";s:5:\"sMail\";s:18:\"nutzer@example.org\";}'),
	(5,NULL,'sNOSERIALS','{config name=mail}','{config name=shopName}','Attention - no free serial numbers for {sArticleName}','Hello,\n\nThere is no additional free serial numbers available for the article {sArticleName}. Please provide new serial numbers immediately or deactivate the article. Please assign a serial number to the customer {sMail} manually.\n\nBest regards,\n\n{config name=shopName}\n','',0,'',2,'a:2:{s:12:\"sArticleName\";s:20:\"ESD Download Artikel\";s:5:\"sMail\";s:23:\"max.mustermann@mail.com\";}'),
	(7,NULL,'sVOUCHER','{config name=mail}','{config name=shopName}','Your voucher','Hello {customer},\n\n{user} has followed your recommendation and just ordered at {config name=shopName}.\nThis is why we give you a X € voucher, which you can redeem with your next order.\n			\nYour voucher code is as follows: XXX\n			\nBest regards,\n{config name=shopName}','',0,'',2,'a:2:{s:8:\"customer\";s:11:\"Peter Meyer\";s:4:\"user\";s:11:\"Hans Maiser\";}'),
	(12,NULL,'sCUSTOMERGROUPHACCEPTED','{config name=mail}','{config name=shopName}','Your trader account has been unlocked','Hello,\n\nYour trader account {config name=shopName} has been unlocked.\n  \nFrom now on, we will charge you the net purchase price. \n  \nBest regards\n  \nYour team of {config name=shopName}','',0,'',2,NULL),
	(13,NULL,'sCUSTOMERGROUPHREJECTED','{config name=mail}','{config name=shopName}','Your trader acount has not been accepted','Dear customer,\n\nThank you for your interest in our trade prices. Unfortunately, we do not have a trading license yet so that we cannot accept you as a trader. \n\nIn case of further questions please do not heitate to contact us via telephone, fax or email. \n\nBest regards\n\nYour Team of {config name=shopName}','',0,'',2,NULL),
	(14,1,'sORDERSTATEMAIL1','{config name=mail}','{config name=shopName}','Change of order status in {config name=shopName}','Dear{if $sUser.billing_salutation eq \"mr\"}Mr{elseif $sUser.billing_salutation eq \"ms\"}Mrs{/if} {$sUser.billing_firstname} {$sUser.billing_lastname},\n\nThe status of your order with order number {$sOrder.ordernumber} of {$sOrder.ordertime|date_format:\" %d-%m-%Y\"} has changed. The new status is as follows: {$sOrder.status_description}.','',0,'',3,NULL),
	(15,2,'sORDERSTATEMAIL2','{config name=mail}','{config name=shopName}','Change of order status in {config name=shopName}','Dear{if $sUser.billing_salutation eq \"mr\"}Mr{elseif $sUser.billing_salutation eq \"ms\"}Mrs{/if} {$sUser.billing_firstname} {$sUser.billing_lastname},\n\nThe status of your order with order number {$sOrder.ordernumber} of {$sOrder.ordertime|date_format:\" %d-%m-%Y\"} has changed. The new status is as follows: {$sOrder.status_description}.','',0,'',3,NULL),
	(19,NULL,'sCANCELEDQUESTION','{config name=mail}','{config name=shopName}','Your aborted order process - Send us your feedback and get a voucher!','Dear customer,\n \nYou have recently aborted an order process on Demoshop.de - we are always working to make shopping with our shop as pleasant as possible. Therefore we would like to know why your order has failed.\n \nPlease tell us the reason why you have aborted your order. We will reward your additional effort by sending you a 5,00 €-voucher. \n \nThank you for your feedback','',0,'',2,NULL),
	(20,NULL,'sCANCELEDVOUCHER','{config name=mail}','{config name=shopName}','Your aborted order process - Voucher code enclosed','Dear customer,\n \nYou have recently aborted an order process on Demoshop.de - today, we would like to give you a 5,00 Euro-voucher - and therefore make it easier for you to decide for an order with Demoshop.de.\n \nYour voucher is valid for two months and can be redeemed by entering the code \"{$sVouchercode}\".\n\nWe would be pleased to accept your order!','',0,'',2,NULL),
