	(44,NULL,'sARTICLEAVAILABLE','{config name=mail}','{config name=shopName}','Your article is available again','Hello, \n\nYour article with the order number {$sOrdernumber} is available again. \n\n{$sArticleLink} \n\nBest regards\nYour Team of {config name=shopName}\n','',0,'',2,NULL),
	(45,NULL,'sACCEPTNOTIFICATION','{config name=mail}','{config name=shopName}','Please confirm your email','Hello, \n\nYou have just subscribed to receive automatic notifications for the article {$sArticleName}.\n\nPlease confirm the notification using the following link: {$sConfirmLink} \n\nRegards your team by {config name = shopName}','',0,'',2,NULL),
	(46,NULL,'sARTICLECOMMENT','{config name=mail}','{config name=shopName}','Evaluate article','Hello {if $sUser.salutation eq \"mr\"}Mr{elseif $sUser.billing_salutation eq \"ms\"}Mrs{/if} {$sUser.billing_firstname} {$sUser.billing_lastname},\n\nYou have recently purchased articles from {config name=shopName}. We would be pleased if you could evaluate these items. Doing so, you can help us improve our services, and you have the opportunity to tell other customers your opinion. \n\nBy the way: You do not necessarily have to comment on the articles you have bought. You can select the ones you like best. We would welcome any feedback that you have. \n\nHere you can find the links to the evaluations of your purchased articles.\n\n\n{foreach from=$sArticles item=sArticle key=key}\n{if !$sArticle.modus}\n{$sArticle.articleordernumber} {$sArticle.name} {$sArticle.link}\n{/if}\n{/foreach}\n\nBest regards,\n\nYour team of {config name=shopName}','<div>\nHello {if $sUser.salutation eq \"mr\"}Mr{elseif $sUser.billing_salutation eq \"ms\"}Mrs{/if} {$sUser.billing_firstname} {$sUser.billing_lastname},\n</br>\nYou have recently purchased articles from {config name=shopName}. We would be pleased if you could evaluate these items. Doing so, you can help us improve our services, and you have the opportunity to tell other customers your opinion. \nBy the way: You do not necessarily have to comment on the articles you have bought. You can select the ones you like best. We would welcome any feedback that you have. \n<br/><br/>\nHere you can find the links to the evaluations of your purchased articles.\n\n<table>\n {foreach from=$sArticles item=sArticle key=key}\n{if !$sArticle.modus}\n <tr>\n  <td>{$sArticle.articleordernumber}</td>\n  <td>{$sArticle.name}</td>\n  <td>\n  <a href=\"{$sArticle.link}\">link</a>\n  </td>\n </tr>\n{/if}\n {/foreach}\n</table>\n\nBest regards,<br />\nYour team of {config name=shopName}\n</div>',1,'',2,NULL),
	(47,NULL,'sORDERSEPAAUTHORIZATION','{config name=mail}','{config name=shopName}','SEPA direct debit mandate','Hello {$paymentInstance.firstName} {$paymentInstance.lastName},\n\nAttached you will find the direct debit mandate form for your order {$paymentInstance.orderNumber}. \nPlease return the completely filled out document by fax or email. \n\nBest regards. \nThe {config name=shopName} team.','<div>\nHello {$paymentInstance.firstName} {$paymentInstance.lastName},<br>\n\n<br>Attached you will find the direct debit mandate form for your order {$paymentInstance.orderNumber}. \nPlease return the completely filled out document by fax or email.<br/>\n\n<br/>Best regards,<br/>\n<br/>The {config name=shopName} team\n</div>',1,'',2,NULL);
